import React, { Component } from 'react';
import './App.scss';
import Header from './header/Header';
import logo from '../assets/Logo/Logo-brainflix.svg';

class App extends Component {
  render () {
    return (
      <Header logo = {logo}></Header>
    );
  }
}

export default App;
